Rolex Monterey Reunion ‘23.

Driving a 962 is one of the most rewarding and difficult challenges I have faced.  I love every minute of it and it takes me back to my roots and the lust for the game. 

Its rare that you replicate two laps, every single shift counts and danger is always present.

After more than a year of refining James w/ @edpinkracingengines has lead a small and humble crew on completely rebuilding this car, and man does it run. 

I love having a small part in bringing these cars back to their full justice-

Thanks to Kevin Doran for always answering my texts, passing on tips and sharing epic stories of engineering and running these cars in the day. 

